Частотный диапазон:  20Гц-20КГц;
Тип амбушюр:  накладные;
Тип соединения:  беспроводные bluetooth

Приятное общение, прослушивание любимых музыкальных композиций обеспечивает гарнитура DEFENDER FreeMotion B520, выполненная из прочных, высококачественных материалов в интересной расцветке. Накладные амбушюры закрепляются на прочном оголовье. Беспроводное соединение ВBluetooth обеспечивает надежную связь с различными устройствами. Встроенный микрофон повышает удобство и комфортность использования наушников. На них располагаются регулятор громкости, предусмотрен переключатель треков.

Гарнитура DEFENDER FreeMotion B520 функционирует в частотном диапазоне от 20 Гц до 20 кГц. Чувствительность динамика составляет 100 дБ. Питание осуществляется через встроенный аккумулятор. В автономном режиме гарнитура работает до 7 ч. Для полной зарядки аксессуара, которая производится через разъем micro-USB, понадобится 2 ч.

