REALME 8 — смартфон для серфинга интернета, запуска требовательных видеоигр и съемки детализированных фотографий. Встроенный высокоскоростной сканер отпечатка пальца под дисплеем поможет защитить данные при краже или потере устройства.

Характеристики

процессор MediaTek Helio G95 частотой 2 ГГц;
6 Гб оперативной памяти;
128 Гб встроенной памяти;
AMOLED-экран с разрешением 2400х1080 рх;
64+8+2+2 Мп основная quad-камера;
16 Мп фронтальная камера;
батарея на 5000 мАч с Dart Charge 30 Ватт;
2 SIM-карты с поддержкой 4G;
поддержка SD-карт;
разъем Type-C;
технология Hi-Res Audio для самого лучшего звучания.
Мультифункциональная камера

Основной объектив на 64 Мп в связке с искусственным интеллектом способен делать детализированные снимки как в ночной, так и в дневной обстановке. Селфи-камера на 16 мегапикселей с фильтрами для улучшения лица и технологией Боке позволит сделать красивые портретные фотографии с размытием фона.

Производительный процессор

Восьмиядерный процессор Helio G95 с тактовой частотой 2 ГГц предназначен для выполнения емких и требовательных задач. Видеоускоритель ARM G76 в тандеме с 6 Гб оперативной памяти обеспечивают стабильную работу системы при больших нагрузках.

Энергоэффективный аккумулятор

Смартфон оснащен батареей на 5000 мАч — для активной работы в течение 24 часов и работы в режиме ожидания до 40 суток без подзарядок. Блок питания на 30 Вт поможет полностью зарядить смартфон за 65 минут.

Смартфон Apple iPhone 13 128Gb, A2631, альпийский зеленый
Память:  оперативная 4 ГБ, встроенная 128 ГБ,
Аккумулятор:  3240 мAч;
Поддержка сетей:  3G; 4G;
Размеры (ШхВхТ):  71.5 х 146.7 х 7.65 мм;
iPhone 13 — смартфон предыдущего поколения Apple с высокой производительностью и хорошей камерой. Телефон оснащен 6,1-дюймовым дисплеем Super Retina XDR и мощным чипом A15 Bionic с 4-ядерным графическим процессором. Прочная конструкция устройства, длительное время автономной работы и быстрое соединение 5G обеспечивают максимальный комфорт при использовании.

Достоинства:

оптическая стабилизация изображения во время съемки;
функция беспроводной зарядки;
мощный 6-ядерный процессор;
технология Face ID;
защитное стекло Ceramic Shield;
аккумуляторная батарея — 3240 мАч;
поддержка 5G.
Яркий OLED-экран

Apple iPhone 13 оснастили 6,1-дюймовым дисплеем Super Retina XDR. Благодаря высокой плотности пикселей четкость текста, фото и видео сохраняются даже под прямыми солнечными лучами, а цветовая гамма выглядит реалистично.

A15 Bionic — сбалансированное решение

Внутри смартфона — 6-ядерный процессор A15 Bionic, изготовленный по 5-нанометровой технологии. Бионический чип обеспечивает высокую производительность графики, защищает конфиденциальность и экономит энергию.

Фото- и видеосъемка с безграничными возможностями

Широкоугольная камера с большим и быстрым сенсором улавливает на 47% больше света (по сравнению с предыдущими моделями), раскрывая каждую деталь даже на темных фотографиях. А благодаря сверхширокоугольному объективу с углом обзора 120° и апертурой f/2,4 ни один объект съемки не останется без внимания.

Снимайте настоящее кино

Одна из новых функций 13-й модели — режим «Киноэффект» при записи видео. Достаточно лишь сфокусироваться на снимаемом объекте, а смартфон автоматически будет перефокусироваться, чтобы изменить глубину резкости в реальном времени.

Благодаря тому, что iPhone 13 поддерживает запись HDR в формате Dolby Vision, можно снимать видеоролики, которые могут соперничать с голливудскими фильмами.

Смартфон Xiaomi Redmi Note 10 Pro 8/128Gb, голубой
Память:  оперативная 8 ГБ, встроенная 128 ГБ,
Аккумулятор:  5020 мAч;
Поддержка сетей:  3G; 4G;
Сканер отпечатка пальцев:  сбоку;
Размеры (ШхВхТ):  76.5 х 164 х 8.1 мм;
Xiaomi Redmi Note 10 Pro — производительный смартфон для выполнения требовательных задач и просмотра видео в высоком разрешении. Камера на 108 Мп для создания фото и записи видео в 4К-разрешении дают возможность по максимуму реализовать свой потенциал.

Характеристики

чипсет Qualcomm Snapdragon 732G частотой 2,3 ГГц;
8 Гб оперативной памяти, 128 Гб встроенной памяти;
AMOLED-экран разрешением 2400х1080;
частота экрана — 120 Гц;
широкоугольный модуль на 108 Мп;
сверхширокоугольная камера — 8 Мп, макро-камера — 5 Мп, фронтальная — 16 Мп;
датчик глубины;
батарея — 5020 мАч;
поддержка быстрой зарядки 33 Вт;
поддержка NFC;
две SIM-карты;
стереодинамики и звук Hi-Res Audio;
ОС MIUI 12/Android 11.
Сверхбыстрая зарядка

Huawei MatePad Pro 11 GOT-AL09 — функциональный планшет, позволяющий работать из любой точки мира. Проводите конференции, наслаждайтесь просмотром фильмов, играйте в игры или разрабатывайте сложные чертежи на одном мобильном устройстве.

Технические характеристики

OC: Harmony OS 3;
диагональ экрана: 28 см (11");
дисплей: 2560×1600 точек, сенсорный мультитач, OLED;
объем внутренней памяти: 256 ГБ, оперативной — 8192 Мб;
карта памяти: NM, до 1 ТБ;
разрешение камер: 13 Мп + 8 Мп, фронтальная: 16 Мп;
емкость аккумулятора: 8300 мАч (до 11,5 часов максимальной активности);
вес: 0,445 кг.
